import { getProfiles } from '../redux/profile';

const Profiles = ({
    getProfiles,
    profile: {
        profiles,
        loading
    }
}) => {
    useEffect(() => {
        getProfiles()
    })
    return (
        <div>
            <h1>
                Where Profiles will be shown
            </h1>
        </div>
